import React from "react";
import styles from "./MainSection.module.css";
import faro from "../../img/faro.png";
import { Link } from "react-router-dom";

const MainSection = () => {
	return (
		<section className={styles.section}>
			<div className={styles.left}>
				<img className={styles.img} alt="Imagen del faro" src={faro} />
			</div>
			<div className={styles.right}>
				<div className={styles.textContainer}>
					<h1 className={styles.h1}>
						Digitalizar tus téxtos ahora es mas fácil y rápido
					</h1>
					<p className={styles.p}>
						JAMER digitalizer es la herramienta que te permite convertir
						imagenes con texto a otros formatos, disponible en npm.
					</p>
					<button className={styles.button} type="button">
						Ver más
					</button>
				</div>
				<ul className={styles.anchorContainer}>
					<li>
						<Link to="/">Acerca del producto</Link>
					</li>
					<li>
						<Link to="/">JAMER para desarolladores</Link>
					</li>
				</ul>
			</div>
		</section>
	);
};

export default MainSection;
